import "./ExpensesList.css";
import ExpenseItem
 from "./ExpenseItem";
function ExpensesList(props){
    let expenseContent = <p>No Expenses added for this year</p>;
  
  if (props.expenseItems.length > 0) {
    return <h2>No Expenses found for this </h2>
    };

    return (
        <ul className="expenses-list">
            {props.expenseItems.map((expense) => (
                <ExpenseItem
                    key={expense.id}
                    title={expense.title}
                    amount={expense.amount}
                    date={expense.date}
                />
            ))}
        </ul>
    )
};

export default ExpensesList;
